function urlget($url){
    $option = [
        CURLOPT_RETURNTRANSFER => true,
        CURLOPT_BINARYTRANSFER => true,
        CURLOPT_TIMEOUT        => 3,
        CURLOPT_MAXREDIRS      => 20,
        CURLOPT_USERAGENT      => 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/109.0.0.0 Safari/537.36', /* Google Chrome に偽装。。。 */
    ];
    $ch = curl_init($url);
    curl_setopt_array($ch, $option);
    $urld    = curl_exec($ch);
    $info    = curl_getinfo($ch);
    $errorNo = curl_errno($ch);
    // OK以外はエラーなので空白配列を返す
    if ($errorNo !== CURLE_OK || $info['http_code'] !== 200) {
        return [];
    }
    // 文字列から変換
    
    switch($info['content_type']){
        case 'application/x-shockwave-flash':
          $url64 = 'data:'.$info['content_type'].';base64,'.base64_encode($urld);
          $im = @getimagesize($url64);
          $wi = $im[0];
          $he = $im[1];
        break;
        
        default:
         $url64 = '';
        break;
        
    }
    curl_close($ch);
    return [$url64 , $wi, $he];
}



